import React, { Component } from "react";
import "./laystyle.css"

class SignUp extends Component{
    state = {
        formData :{
            name : "",
            email : " ",
            gender : " "

        }
    };


    render(){
        return(
        <form id="signup">
             <label> UserName </label>
          <input type="text" required />

          <label>Email Address </label>
            <input type="email"required />

            <label>Gender </label>
        <nav>
        <input className="w3-radio" type="radio" name="gender" value="male" checked></input>
            <option className="gender">Male</option>

           <input className="w3-radio" type="radio" name="gender" value="female"></input>
            <option className="gender">Female</option>
  
           <input className="w3-radio" type="radio" name="gender" value="" disabled></input>
           <option  className="gender">other</option>
        </nav>
            
        
<br></br>
            <label> Set Password</label>
            <input type="password"  required />

            <button type="submit" id="submit">submit</button>
        </form>
           
        )
    }
}
  export default SignUp;
